import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter, Routes, Route, } from "react-router-dom";

import './index.css';

import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<App />} >
        <Route path="/home" element={<HomePage onUrlChange={onUrlChange} onSearchClick={onSearchClick} searchValue={searchValue}/>} />
        <Route path="/games" element={<GamesPage onUrlChange={onUrlChange} onSearchClick={onSearchClick} searchValue={searchValue}/>} />
      </Route>
      <Route path="*" element={<div>wrong url</div>} />
    </Routes>
  </BrowserRouter>
);
